import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';

const Header = () => {
  return (
    <Navbar bg="light" expand="lg" className="py-3">
      <Container>
        <Navbar.Brand href="#home" className="fw-bold fs-3">
          PropertyProinsider
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Nav.Link href="#home" className="px-3">HOME</Nav.Link>
            <Nav.Link href="#news" className="px-3">REAL ESTATE NEWS</Nav.Link>
            <Nav.Link href="#stories" className="px-3">HOUSE STORIES</Nav.Link>
            <Nav.Link href="#advice" className="px-3">REAL ESTATE ADVICE</Nav.Link>
            <Nav.Link href="#decor" className="px-3">HOME DECORATION</Nav.Link>
            <Nav.Link href="#propertypro" className="px-3">PROPERTYPRO</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default Header;
